import React from 'react';
import classes from "./NewsList.module.css";
import NewsPlate from "../NewsPlate/NewsPlate";
import {useHistory} from 'react-router-dom'

const NewsList = () => {
    const router = useHistory();
    const News = [
        {id: 1, title: "Title 1", summary: "summarysummarysummarysummary"},
        {id: 2, title: "Title 2", summary: "summarysummarysummarysummary"},
        {id: 3, title: "Title 3", summary: "summarysummarysummarysummary"},
        {id: 4, title: "Title 4", summary: "summarysummarysummarysummary"},
        {id: 5, title: "Title 5", summary: "summarysummarysummarysummary"},
    ]
    return (
        <div className={classes.news}>
            {News.map((nw)=>
                <NewsPlate item={nw} onClick={router.push(`/news/${nw.id}`)}/>
            )}
        </div>
    );
};

export default NewsList;
